import React from 'react'
import { Route, Redirect } from 'react-router-dom'
import HandleLogin from './'

const PublicRoute = ({restricted,...rest}) => {
    return (
        <Route {...rest} render={() => (
            restricted ? 
            <Redirect to="/homepage" />
            :  
            <HandleLogin/>
        )} />
    )
}

export default PublicRoute
